@Will-Clements We have discrepancies between the container indicators in Alma and those in ASpace (e.g. leading zeroes). This is preventing a match on container type + indicator. 

I've created a new tab in your Google sheet with the ASpace top_containers for the selected collections; could you check the numbering in the Alma item records and, if different from ASpace, add it to column F please? 

(Feel free to delete any rows for ASpace containers that are not in Alma from this tab if that makes things easier.)
